  var $parts = $(this).attr("href").split("/add/");
  var $sku = $parts[1];

  var $quant = $(this).closest("form").find("select").val();
  if (!$quant) $quant = 1;

  //var modalSize = 'small-modal';
  //$('.site-mask').fadeIn();
  //$('.site-modal').attr('class', 'site-modal '+modalSize);
